import React from "react";
import {Link} from 'react-router-dom';

function Header() {
    return (
        <div>
            <div className="container-fluid">
                <div className="row" id="logo-1st">
                    <div className="col-4 text-center d-xl-block d-none">
                        <p className="lead font-weight-bold" id="position"><a href="https://goo.gl/maps/ynXyvTbm94ah4HA86" target="_blank" id="posLink">Via Bologna 94/A - 90047 Partinico (PA)</a></p>
                    </div>
                    <div className="col-12 col-xl-4 ml-md-0 text-center">
                        <Link to="/">
                            <img src={require("../img/logo.png")} alt="logo" className="w-75 ml-5" id="logo"></img>
                        </Link>
                    </div>
                    <div className="col-4 d-none d-xl-block text-center">

                    </div>
                </div>
                <div className="row container-fluid mt-5" id="navigation">
                    <h2 className="navbar-motto text-center align-content-center">La scelta migliore per i tuoi eventi</h2>
                </div>
            </div>
        </div>
    );
}

export default Header;
